data.forEach(function(d) {
    d.diferenca_tempo = +d.diferenca_tempo;
    d.feeling_aleatoriedade = +d.feeling_aleatoriedade;
    d.sd_regioes = +d.sd_regioes;
});

x.domain(d3.extent(data, function(d) { return d.diferenca_tempo; })).nice();
y.domain(d3.extent(data, function(d) { return d.feeling_aleatoriedade; })).nice();

var color = d3.scale.linear()
        .domain([0, d3.max(data, function(d) {return d.sd_regioes})])
        .range(["white","#4169e1"]);

svg.append("g")
    .attr("class", "x axis")
    .attr("transform", "translate(0," + height + ")")
    .call(xAxis)
    .append("text")
    .attr("class", "label")
    .attr("x", width)
    .attr("y", -6)
    .style("text-anchor", "end")
    .text("Tempo de execução do formulário (seg)");

svg.append("g")
    .attr("class", "y axis")
    .call(yAxis)
    .append("text")
    .attr("class", "label")
    .attr("transform", "rotate(-90)")
    .attr("y", 6)
    .attr("dy", ".71em")
    .style("text-anchor", "end")
    .text("Nota de aleatoriedade (0 - 10)");

svg.selectAll(".dot")
    .data(data)
    .enter().append("circle")
    .attr("class", "dot")
    .attr("r", 3.5)
    .attr("cx", function(d) { return x(d.diferenca_tempo); })
    .attr("cy", function(d) { return y(d.feeling_aleatoriedade); })
    .style("fill", function(d) { return color(d.sd_regioes); });


